Car Hop Tray<br>
<br>
カーホップサービスの、50sスタイルハンバーガーショップで見る事の出来るトレイです。ウィンドーに引っ掛けるだけでアメリカン・グラフィティの世界。<br>Car Showのディスプレイにも使えます。<br>
<br>
サイズ：35×26cm<br>
<br>
＊少量ずつしか入手できない為、お届けまでにお時間が掛かる場合があります。<style type="text/css">
